The miscellaneous items can be obtained as drops from [[ogress warrior]]s and [[ogress shaman]]s, the [[Stronghold of Security]] NPCs such as [[minotaur]]s, [[flesh crawler]]s, [[catablepon]]s and [[ankou]], as well as [[moss giant]]s and [[hill giant]]s.

While [[dragonstone full helm]], [[dragonstone platebody]], and [[dragonstone platelegs]] can be bought and worn by [[free-to-play]] players, they cannot be obtained from the [[Elven Crystal Chest]] to complete the [[collection log]] entries.

